import 'bootstrap-4-react';
import './main/main.css';
import React, { useState } from 'react';

import Header from './header/header';
import Content from './content/content';
import Footer from './footer/footer';

import Logo from './header/logo.svg';

import './style.css';

function App() {
  const [link, setLink] = useState("home");

  return (
    <>
      <header>
        <ul>
            <li className="d-flex logo">
                <img src={Logo} style={{
                    marginRight: "10px",
                }} />
                <h2>Gyber.org</h2>
            </li>
            <li>
                <ul className="d-flex space-between list">
                    <li>Home</li>
                    <li>Philosophy</li>
                    <li>Lite Paper</li>
                </ul>
            </li>
            <li>
                {link == "home" ? <a onClick={() => setLink("sale")} className="rgbBtn">Private sale</a> : <a onClick={() => setLink("home")} className="rgbBtn">Home</a>}
            </li>
        </ul>
        {/* <Header/> */}
      </header>
      <main>
        <div className='container'>
          <Content name="home"/>
        </div>
      </main>
      <footer>
        <Footer/>
      </footer>
    </>
  );
}

export default App;
